/**
 *  Event names should follow the following format 'EventName:Action'
 *
 *  e.g.
 *  'configure:start'
 *  'configure:end'
 *
 * @internal
 */
export default class ReservedEventNames {
    static readonly delimitor: string;
    static readonly configure: string;
    static readonly start: string;
    static readonly end: string;
    static readonly configureStart: string;
    static readonly configureEnd: string;
    static readonly classicToolpane: string;
    static readonly classicToolpaneId: string;
}
